import React from 'react'
import Header from './Components/Header'

import './Css/Global.css'

const App = () => {
    const [ativo, setAtivo] = React.useState(false)

    function handleClick() {
        setAtivo(!ativo)
    }

    return <>
        <Header event={handleClick} />
    </>
}

export default App
